import React from 'react';
import {Link} from 'react-router-dom';

const Navbar = ({toDo}) => {
  return (
    <div>
      <Link to="/">Home</Link>
      <Link to="/calculator">Calculator</Link>
      <Link to="/todotracker">ToDoTracker</Link>
    </div>

  );

};

export default Navbar;
